def solve(lst, W):
	# print(lst, W)
	n = len(lst)
	if n == 0:
		return 0
	elif n == 1:
		return lst[0]
	res = 0
	for i in range(1, n):
		if lst[i] > W:
			res += lst[i]
		else:
			res += lst[i] - W
	return res

